se to be loaded to the browser every page load by appending an additional timestamp in the version information. This is useful during development and debugging where changes are being made to javascript and CSS files.','bool','','0',0,0,'Developer and Customization','',0,0),('FORCEALLOWCONFRECORDING','0','Force Allow Conference Recording',0,'Until Asterisk 14+ a random timestamp would be added to the end of the conference call recording which could not be determined in post call handling. Thus enabling conference call recording is disabled if using Asterisk 13 or lower. Enable this option to allow Conference Call recording to be enabled in Astrisk 13 or lower','bool','','0',0,0,'Conferences','conferences',0,-133),('FORCED_ASTVERSION','','Force Asterisk Version',4,'Normally FreePBX gets the current Asterisk version directly from Asterisk. This is required to generate proper dialplan for a given version. When using some custom Asterisk builds, the version may not be properly parsed and improper dialplan generated. Setting this to an equivalent Asterisk version will override what is read from Asterisk. This SHOULD be left blank unless you know what you are doing.','text','','',1,0,'System Setup','',1,-100),('FPBX_ARI_PASSWORD','781446df332484990568632fb0b2af1d','ARI Password',0,'Password for internal ARI calls','text','','781446df332484990568632fb0b2af1d',1,0,'Asterisk REST Interface','arimanager',0,99),('FPBX_ARI_USER','freepbxuser','ARI Username',0,'Username for internal ARI calls','text','','freepbxuser',1,0,'Asterisk REST Interface','arimanager',0,98),('FPBX_LOG_FILE','/var/log/asterisk/freepbx.log','FreePBX Log File',0,'Full path and name of the FreePBX Log File used in conjunction with the Syslog Level (AMPSYSLOGLEVEL) being set to FILE, not used otherwise. Initial installs may have some early logging sent to /tmp/freepbx_pre_install.log when it is first bootstrapping the installer.','text','','/var/log/asterisk/freepbx.log',0,0,'System Setup','',0,-150),('FPBXDB