ansfered into a page.','text','','from-internal-xfer',1,1,'Dialplan and Operational','',1,0),('TRUNK_OPTIONS','T','Asterisk Outbound Trunk Dial Options',0,'Options to be passed to the Asterisk Dial Command when making outbound calls on your trunks when not part of an Intra-Company Route. The options are documented in Asterisk documentation, a subset of which are described here. The default option T allows the calling user to transfer a call with ##. It is HIGHLY DISCOURAGED to use the r option here as this will prevent early media from being delivered from the PSTN and can result in the inability to interact with some external IVRs','text','','T',0,0,'Dialplan and Operational','',1,0),('TRUNK_RING_TIMER','300','Trunk Dial Timeout',2,'How many seconds to try a call on your trunks before giving up. This should normally be a very long time and is usually only changed if you have some sort of problematic trunks. This is the Asterisk Dial Command timeout parameter.','int','0,86400','300',1,0,'Dialplan and Operational','',0,0),('UCP_MESSAGE_LIMIT','3000','UCP Message Limit',3,'Limit the Messages to be Displayed in UCP. If your device has more processing power you can increase this otherwise lower it if you find your system not responsive','int','1,100000','3000',0,0,'Voicemail Module','voicemail',0,100),('UCPCHANGEPASSWORD','1','Allow Password Changes',1,'Allow users to change thier password in UCP','bool','','1',0,0,'User Control Panel','ucp',0,355),('UCPCHANGEUSERNAME','1','Allow Username Changes',1,'Allow users to change their username in UCP','bool','','1',0,0,'User Control Panel','ucp',0,355),('UCPRSSFEEDS','','RSS Feeds',0,'RSS Feeds that are displayed in UCP. This overrides \"System Setup\" for UCP. If this is blank then the feeds will be taken from RSS Feeds under \"System Setup\". Separate each feed by a new line','textarea','','',0,0,'User Control Panel','ucp',1,355),('UCPSESSIONTIMEOUT','30','UCP Session Timeout',1,'The number of days a session token will be valid for. Clear this setting if you want tokens to last forever (Not Recommended)','text','','30',0,0,'User Control Panel','ucp',1,355),('UIDEFAULTLANG','en_US','Default language',0,'The default language used in the webUI','text','','en_US',0,0,'System Setup','',0,0),('USE_FREEPBX_MENU_CONF','0','Use freepbx_menu.conf Configuration',0,'When set to true, the system will check for a freepbx_menu.conf file amongst the normal configuraiton files and if found, it will be used to define and remap the menu tabs and contents. See http://wiki.freepbx.org/x/6YDGAg for more details','bool','','0',0,0,'GUI Behavior','',0,0),('USE_GOOGLE_CDN_JS','0','Use Google Distribution Network for js Downloads',0,'Setting this to true will fetch system javascript libraries such as jQuery and jQuery-ui from ajax.googleapis.com. This can be advantageous if accessing remote or multiple different FreePBX systems since the libraries are only cached once in your browser. If external internet connections are problematic, setting this true could result in slow systems. FreePBX will always fallback to the locally available libraries if the CDN is not available.','bool','','0',0,0,'System Setup','',0,0),('USE_PACKAGED_JS','1','Use Packaged Javascript Library ',2,'FreePBX packages several javascript libraries and components into a compressed file called libfreepbx.javascript.js. By default this will be loaded instead of the individual uncompressed libraries. Setting this to false will force FreePBX to load all the libraries as individual uncompressed files. This is useful during development and debugging.','bool','','1',0,0,'Developer and Customization','',0,0),('USEGOOGLEDNSFORENUM','0','Use Google DNS for Enum',2,'Setting this flag will generate the required global variable so that enumlookup.agi will use Google DNS 8.8.8.8 when performing an ENUM lookup. Not all DNS deals with NAPTR record, but Google does. There is a drawback to this as Google tracks every lookup. If you are not comfortable with th