=\\\"screen-reader-text\\\">PBX MFA \\u2013 New FreePBX Commercial Module Release<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/mfa-new-freepbx-module-authentication\\/\\\">PBX MFA \\u2013 New FreePBX Commercial Module Release<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"SMS Plus: Enhanced SMS functionality for FreePBX \\/ PBXact\",\"url\":\"https:\\/\\/www.freepbx.org\\/sms-plus-enhanced-sms-functionality-for-freepbx-pbxact\\/\",\"content\":\"\\n<p>Hi Everyone, We are very pleased to announce the release of a new module named \\u201cSMS Plus\\u201d to enhance the SMS functionality in FreePBX\\/PBXact. This module provides the following functionalities: SMS Blocking Integration with the Blacklist module allows the PBX users to block any abusive users and add their caller-ID to the Blacklist module. PBX \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/sms-plus-enhanced-sms-functionality-for-freepbx-pbxact\\/\\\"> <span class=\\\"screen-reader-text\\\">SMS Plus: Enhanced SMS functionality for FreePBX \\/ PBXact<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/sms-plus-enhanced-sms-functionality-for-freepbx-pbxact\\/\\\">SMS Plus: Enhanced SMS functionality for FreePBX \\/ PBXact<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"Keep an Eye on the Dashboard\",\"url\":\"https:\\/\\/www.freepbx.org\\/keep-an-eye-on-the-dashboard\\/\",\"content\":\"\\n<p>This past week saw two noteworthy threads posted to the FreePBX community forum separated by a few days; independent reports of a \\u201cTampered File Warning\\u201d showing up in the FreePBX dashboard. This warning is connected to a core security feature of FreePBX. In FreePBX (and PBXact) each module is published with a signature, and in \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/keep-an-eye-on-the-dashboard\\/\\\"> <span class=\\\"screen-reader-text\\\">Keep an Eye on the Dashboard<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/keep-an-eye-on-the-dashboard\\/\\\">Keep an Eye on the Dashboard<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"EOL Notice for FreePBX 13 and 14\",\"url\":\"https:\\/\\/www.freepbx.org\\/eol-notice-for-freepbx-13-and-14\\/\",\"content\":\"\\n<p>The GA release for FreePBX 16 was about a year ago now, and since that time both versions 15 and 16 have continued to get new features and updates.\\u00a0 The majority of our current development efforts now are laser focused on the next version of FreePBX, which will be built on a new FreePBX Distro \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/eol-notice-for-freepbx-13-and-14\\/\\\"> <span class=\\\"screen-reader-text\\\">EOL Notice for FreePBX 13 and 14<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/eol-notice-for-freepbx-13-and-14\\/\\\">EOL Notice for FreePBX 13 and 14<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"FreePBX &amp; Asterisk Aloft \\u2013 Life Is Better In the Cloud\",\"url\":\"https:\\/\\/www.freepbx.org\\/freepbx-asterisk-aloft-life-is-better-in-the-cloud\\/\",\"content\":\"\\n<p>For years, Sangoma has offered cloud based PBX hosting with PBXact Cloud, the fully supported commercial system powered by FreePBX and Asterisk. Last year, PBXact Cloud relaunched as version 2.0 with some fun work going behind the scenes. If you\\u2019ve been watching the evolution of the GraphQL features in the API module, you will have \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/freepbx-asterisk-aloft-life-is-better-in-the-cloud\\/\\\"> <span class=\\\"screen-reader-text\\\">FreePBX &amp; Asterisk Aloft \\u2013 Life Is Better In the Cloud<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/freepbx-asterisk-aloft-life-is-better-in-the-cloud\\/\\\">FreePBX &amp; Asterisk Aloft \\u2013 Life Is Better In the Cloud<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"Sangoma Phone for FreePBX\",\"url\":\"https:\\/\\/www.freepbx.org\\/sangoma-phone-for-freepbx\\/\",\"content\":\"\\n<p>Back in February, Sangoma announced the beta launch of Sangoma Phone, the next generation desktop client for FreePBX and PBXact systems. Sangoma Phone is an evolution of the desktop client available for years on the Switchvox platform. After several months of successful deployments and incremental releases of new features, we\\u2019re officially announcing the end of \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/sangoma-phone-for-freepbx\\/\\\"> <span class=\\\"screen-reader-text\\\">Sangoma Phone for FreePBX<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/sangoma-phone-for-freepbx\\/\\\">Sangoma Phone for FreePBX<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"Announcing Sangoma Connect Mobile Apps\",\"url\":\"https:\\/\\/www.freepbx.org\\/announcing-sangoma-connect-mobile-apps\\/\",\"content\":\"\\n<p>Hi Everyone, We are very pleased to announce the immediate availability of a suite of new features for the Sangoma Connect mobile app. These new integrated apps for Sangoma Connect provide the freedom for users to use native PBX features of your FreePBX or PBXact system from any place, anytime directly from their mobile device. \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/announcing-sangoma-connect-mobile-apps\\/\\\"> <span class=\\\"screen-reader-text\\\">Announcing Sangoma Connect Mobile Apps<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/announcing-sangoma-connect-mobile-apps\\/\\\">Announcing Sangoma Connect Mobile Apps<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"Re: Palo Alto Jul 15 2022 PBX Security Blog Post\",\"url\":\"https:\\/\\/www.freepbx.org\\/re-palo-alto-jul-15-2022-pbx-security-blog-post\\/\",\"content\":\"\\n<p>On July 15, 2022, Palo Alto Networks published a blog \\u201cDigium Phones Under Attack: Insight Into the Web Shell Implant\\u201d warning of high volume of malicious IP traffic targeting \\u201cSangoma PBX\\u201d phone systems. The blog post references the exploit CVE-2021-45461 that was originally reported on Dec 2021 over 6 months ago. Sangoma is a leading, \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/re-palo-alto-jul-15-2022-pbx-security-blog-post\\/\\\"> <span class=\\\"screen-reader-text\\\">Re: Palo Alto Jul 15 2022 PBX Security Blog Post<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/re-palo-alto-jul-15-2022-pbx-security-blog-post\\/\\\">Re: Palo Alto Jul 15 2022 PBX Security Blog Post<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"A few announcements\",\"url\":\"https:\\/\\/www.freepbx.org\\/a-few-announcements\\/\",\"content\":\"\\n<p>Dear Asterisk and FreePBX Communities, Today I would like to announce the advancement of Joshua Colp to Asterisk Project Lead and Lorne Gaetz to FreePBX Project Lead, with Kapil Gupta acting as Engineering Lead for FreePBX. For those that know them well, they already do so much for the community that this is a formal \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/a-few-announcements\\/\\\"> <span class=\\\"screen-reader-text\\\">A few announcements<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/a-few-announcements\\/\\\">A few announcements<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"},{\"title\":\"Sangoma Phone Beta for FreePBX\",\"url\":\"https:\\/\\/www.freepbx.org\\/sangoma-phone-beta-for-freepbx\\/\",\"content\":\"\\n<p>Sangoma Phone is Sangoma\\u2019s next generation desktop softphone and we\\u2019re happy to announce it\\u2019s now in open beta and ready for FreePBX and PBXact administrators to try it out. Sangoma Phone is based on the Switchvox Phone desktop client, which has been in use for a long time on the Switchvox platform. The FreePBX Engineering \\u2026<\\/p>\\n<p class=\\\"read-more\\\"> <a class=\\\"\\\" href=\\\"https:\\/\\/www.freepbx.org\\/sangoma-phone-beta-for-freepbx\\/\\\"> <span class=\\\"screen-reader-text\\\">Sangoma Phone Beta for FreePBX<\\/span> Read More \\u00bb<\\/a><\\/p>\\n<p>The post <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/sangoma-phone-beta-for-freepbx\\/\\\">Sangoma Phone Beta for FreePBX<\\/a> appeared first on <a rel=\\\"nofollow\\\" href=\\\"https:\\/\\/www.freepbx.org\\/\\\">FreePBX - Let Freedom Ring<\\/a>.<\\/p>\\n\"}]}'),('63825222-efd9-4914-aeea-0328fc7592ff',