INSERT INTO `notifications` VALUES ('dahdiconfig','',400,'File  does not exist.','Please run \'touch \' and then \'fwconsole chown\' to create this file.','',0,1,1678163916),('framework','BROWSER_STATS',600,'Collecting Anonymous Browser Stats','The FreePBX project is collecting anonymous browser statistics using google analytics. These are used to focus development efforts based on real user input. All information is anonymous. You can disable this in Advanced Settings with the Browser Stats setting.','',0,1,1678163423),('framework','missing_html5',600,'Missing HTML5 format converters','You are missing support for the following HTML5 codecs: m4a,mp3. To fully support HTML5 browser playback you will need to install programs that can not be distributed with FreePBX. If you\'d like to install the binaries needed for these conversions click \'Resolve\' in the lower left corner of this message. You can also safely ignore this message but browser playback might not work in your browser.','http://wiki.freepbx.org/display/FOP/Installing+Media+Conversion+Libraries',0,1,1678163422),('retrieve_conf','SYMLINKNOTICE',600,'Symlink Conflict Resolved','retrieve_conf resolved a symlink with <br />&nbsp;&nbsp;&nbsp;/etc/asterisk/ari.conf<br />&nbsp;&nbsp;&nbsp;/etc/asterisk/cel.conf<br \\>This is a notice to let you know that the original file was moved to /etc/asterisk/backup, there is nothing more you need to do','',0,1,1678163939),('sipsettings','BINDPORT',600,'Default bind port for CHAN_PJSIP is: 5060, CHAN_SIP is: 5160','The default bind ports for FreePBX have changed. Please keep this is mind while configuring your devices. You can change this in SIP Settings. CHAN_PJSIP is: 5060, CHAN_SIP is: 5160','https://wiki.freepbx.org/display/HTGS/CHAN_PJSIP+vs+CHAN_SIP',0,1,1678163317);
